export default async (context) => {
  const ch = await Hihat(context, 1/16)
  const oh = await Hihat(context, 1/4)
  return t =>
    + ch(t)*.2
    + oh(t+1/2)*1
}

export const Hihat = async (context, rate = 1/4) => {
  var hihat = 0
  var hihat_osc = Wavetable(context, 'noise', 15000, true)
  var hihat_delay = Array(100).fill(0)

  return t => {
    hihat = hihat_osc(1.2)
    hihat *= arp(t, rate, 1200, 20, 70)
    //hihat *= envelope(t+1/16, 1/16, 100, 3.8, 8, 70)
    hihat = clip(hihat, .61)
    hihat *= arp(t, 1/4, 10100, 17, 1)
    hihat_delay.push(-hihat)
    hihat_delay.shift()
    return (
      + hihat
      + hihat_delay[98] * .8
      + hihat_delay[69] * .7
      - hihat_delay[25] * .5
      - hihat_delay[72] * .7
    ) * .3
  }
}
